import React from 'react';
import { Carousel } from 'react-bootstrap';
import firstFoto from '../../images/carousel/car_first.jpg';
import secondFoto from '../../images/carousel/car_second.jpg';
import thirdFoto from '../../images/carousel/car_third.jpg';
import fourthFoto from '../../images/carousel/car_fourth.jpg';
import fifthFoto from '../../images/carousel/car_fifth.jpg';
import sixthFoto from '../../images/carousel/car_sixth.jpg';
import InstagramEmbed from './InstagramEmbed';

const Gallery = () => {
  const reel = 'https://www.instagram.com/p/C7fVZ5rJoYm/';
  return (
    <div className="gallery-container">
      <div className="carousel-wrapper"> {/* Adjust padding as needed */}
        <Carousel indicators={false} prevLabel="" nextLabel="">
          <Carousel.Item>
            <InstagramEmbed embedUrl={reel} />
          </Carousel.Item>
          <Carousel.Item>
            <div className="d-flex justify-content-between">
              <img
                className="d-block w-30 diagonal-clip"
                src={fourthFoto}
                alt="Fourth slide"
                style={{ height: '650px' }} // Add margin-right for spacing
              />
              <img
                className="d-block w-30 diagonal-clip"
                src={fifthFoto}
                alt="Fifth slide"
                style={{ height: '650px' }} // Add margin-right for spacing
              />
              <img
                className="d-block w-30 diagonal-clip"
                src={sixthFoto}
                alt="Sixth slide"
                style={{ height: '650px' }} // Add margin-right for spacing
              />
            </div>
          </Carousel.Item>
        </Carousel>
      </div>
      <div className="gallery-title">
        <h1>Galer√≠a</h1>
      </div>
    </div>
  );
};

export default Gallery;
